import React, { useEffect, useState } from "react";
import { WeatherCard } from "./components/WeatherCard";
import { Footer } from "./components/Footer";
import { TodayWeatherCard } from "./components/TodayWeatherCard";
import { GetWeahterData, WeatherData } from "./api/WeatherApi";

function App() {
  //useEffect(() => {//isviekcia api call ir nusettina state}, []);
  // Isivykdo kai komponentas yra uzkraunamas arba kai state yra pakeiciamas
  //

  const [weatherData, setWeatherData] = useState<WeatherData | null>();
  const [weatherArrayTimeIndex, setWeatherArrayTimeIndex] = useState<number>(0);
  const [weatherArrayDateIndex, setWeatherArrayDateIndex] = useState<number>(0);
  const [weatherDate, setWeatherDate] = useState<string>("");
  const [finalDate, setFinalDate] = useState<string>("");

  useEffect(() => {
    const fetchData = async () => {
      let response = await GetWeahterData();
      setWeatherData(response);
    };

    // Get today
    let dateNow = new Date();
    let timeNow = dateNow.getHours();

    let today: string;
    today =
      dateNow.getFullYear() +
      "-0" +
      (dateNow.getMonth() + 1) +
      "-" +
      dateNow.getDate() +
      "T12:00";

    let indexOfToday = weatherData?.hourly.time.indexOf(today) ?? 0;

    // Get hourly time for this day weather
    setWeatherArrayTimeIndex(timeNow - 1);

    // Setting temperature
    setWeatherArrayDateIndex(indexOfToday);

    // Setting date
    let tommorowIndex = indexOfToday + 1;
    setWeatherDate(
      weatherData?.hourly.time[weatherArrayDateIndex + 1]
        .split("T")[0]
        .split("2023-")[1] ?? ""
    );
    console.log(weatherDate);
    setFinalDate(weatherDate.split("T")[0].split("2023-")[1]);
    console.log(finalDate);

    fetchData();
  }, []);

  return (
    <>
      <TodayWeatherCard
        temperature={
          weatherData?.hourly.temperature_2m[weatherArrayTimeIndex] ?? 0
        }
      />
      <WeatherCard
        temperature={
          weatherData?.hourly.temperature_2m[weatherArrayDateIndex + 24] ?? 0
        }
        date={
          weatherData?.hourly.time[weatherArrayDateIndex + 1]
            .split("T")[0]
            .split("2023-")[1] ?? ""
        }
      />
      <WeatherCard
        temperature={
          weatherData?.hourly.temperature_2m[weatherArrayDateIndex + 48] ?? 0
        }
        date={
          weatherData?.hourly.time[weatherArrayDateIndex + 2]
            .split("T")[0]
            .split("2023-")[1] ?? ""
        }
      />
      <WeatherCard
        temperature={
          weatherData?.hourly.temperature_2m[weatherArrayDateIndex + 72] ?? 0
        }
        date={
          weatherData?.hourly.time[weatherArrayDateIndex + 3]
            .split("T")[0]
            .split("2023-")[1] ?? ""
        }
      />
      <WeatherCard
        temperature={
          weatherData?.hourly.temperature_2m[weatherArrayDateIndex + 96] ?? 0
        }
        date={
          weatherData?.hourly.time[weatherArrayDateIndex + 4]
            .split("T")[0]
            .split("2023-")[1] ?? ""
        }
      />
      <WeatherCard
        temperature={
          weatherData?.hourly.temperature_2m[weatherArrayDateIndex + 120] ?? 0
        }
        date={
          weatherData?.hourly.time[weatherArrayDateIndex + 5]
            .split("T")[0]
            .split("2023-")[1] ?? ""
        }
      />
      <WeatherCard
        temperature={
          weatherData?.hourly.temperature_2m[weatherArrayDateIndex + 144] ?? 0
        }
        date={
          weatherData?.hourly.time[weatherArrayDateIndex + 6]
            .split("T")[0]
            .split("2023-")[1] ?? ""
        }
      />
      <Footer />
    </>
  );
}

export default App;
